class Solution:
    def maximumValueSum(self, board: List[List[int]]) -> int:
        top3=[]        
        for i in range(len(board)):
            top3.append(sorted(list(zip(range(len(board[0])),board[i])),key=lambda x:-x[1])[:3])
        def f(i,j,k):
            res=-float('inf')
            for i1,v1 in top3[i]:
                for i2,v2 in top3[j]:
                    for i3,v3 in top3[k]:
                        if i1!=i2 and i1!=i3 and i2!=i3:
                            res=max(res,v1+v2+v3)
            return res 

        out=-float('inf')
        for i in range(len(board)-2):
            for j in range(i+1,len(board)-1):
                for k in range(j+1,len(board)):
                    out=max(out,f(i,j,k))
        return out
